import React from "react";
import "./Card.css";
const Card = props => {
  return (
    <div className="col">
      <div className="card" style={{ width: "17rem" }}>
        <img
          src={props.image}
          className="card-img-top"
          alt="shabuMenu"
          style={{ height: "197px" }}
        ></img>
        <div className="card-body">
          <p className="card-text" style={{ textAlign: "center" }}>
            {props.text}
          </p>
        </div>
      </div>
    </div>
  );
};
export default Card;
